import logo from "../logo.svg";
import React, { Component } from "react";


export default class HeaderComponent extends Component {
  constructor(props) {
    super(props);

    this.state = {};

    this.addStudent=this.addStudent.bind(this);
  }

  addStudent()
  {
      this.props.history.push('add-student/_add');
  }

  render() {
    return (
      <div>
        <header>
          <nav className="navbar navbar-expand-md navbar-dark bg-dark"></nav>
          <div className="space-left2" style={{Height:12} , {width:12}}>
          <img src={logo} className="App-logo" alt="logo" />
          </div>
          <div className="space-right2">
          <div className="navbar-brand">
            <h1 className="text-center">Student Management Application</h1>
          </div>
          </div>
          
          <div className="row">
            <button className="btn btn-primary" onClick={this.addStudent}>
              Add Student
            </button>
          </div>
        </header>
      </div>
    );
  }
}
